import React, { Component } from 'react'

export default class LeftNav extends Component {
  render() {
    return (
      <div className="LeftNav_Card">
          <ul className='leftNav'>
              <li> <i class="material-icons">person</i> Posts</li>
              <li> <i class="material-icons">collections</i> Galleries</li>
              <li> <i class="material-icons">fastfood</i> Recipies</li>
              <li> <i class="material-icons">device_hub</i> Family Tree</li>
          </ul>
      </div>
    )
  }
}
